(function ($) {
    $(function () {
        if ($.bwin === undefined) {
            $.bwin = {};
        }

        var flash = $('#flash');
        var messageViewer = flash.find('ul.message-viewer').length !== 1 ?
                $('<ul>').addClass('message-viewer').appendTo(flash) :
                flash.find('ul.message-viewer');
        var personalButton = $('#header').find('li.personal-button');
        var closeLink = $('<div>').addClass('close').text(flash.data('close-message'));

        $.bwin.personalbutton = function () {
            if (messageViewer.length === 1) {
                var hasMessages = messageViewer.find('li').length > 0;

                messageViewer.find('li').last().addClass('last').append(closeLink);

                // Adjust display of any existing messages on page load.
                if (hasMessages) {
                    personalButton.addClass('active has-messages');
                    flash.show();
                    // position relative to personal button (if user is authenticated)
                    if (personalButton.length === 1) {
                        messageViewer.position({
                                my: "center top",
                                at: "center bottom",
                                of: personalButton,
                                offset: "0 -1"
                            });
                    }
                }

                // Handle message viewer toggling `onclick`.
                personalButton.live('click', function () {
                    if (personalButton.hasClass('has-messages')) {
                        flash.toggle();

                        if (flash.is(':visible')) {
                            if (!$(this).hasClass('active')) {
                                $(this).addClass('active');
                            }
                        } else {
                            $(this).removeClass('active');
                        }
                    }

                    return false;
                });

                // Handle hiding message viewer `onclick`.
                flash.find('.message-viewer div.close').live('click', function () {
                    flash.hide();
                    personalButton.removeClass('active');
                });
            }
        };

        // Can be used to add a message to viewer container.
        $.bwin.personalbutton.addMessage = function (message) {
            var messageEl = $('<li>').addClass(message.type)
                    .data({ rel: message.rel || '' })
                    .html(message.text);

            messageViewer.prepend(messageEl);

            if (!messageViewer.find('li').last().hasClass('last')) {
                messageViewer.find('li').last().addClass('last');
            }
            if (messageViewer.find('li:last div.close').length === 0) {
                messageViewer.find('li').last().append(closeLink);
            }

            flash.show();

            if (!personalButton.hasClass('active')) {
                personalButton.addClass('active');
            }
            if (!personalButton.hasClass('has-messages')) {
                personalButton.addClass('has-messages');
            }
        };

        // Can be used to replace a message within message viewer.
        // `options == {
        //      message: {
        //          rel:  [String],
        //          text: [String]
        //      },
        //      doAddCloseLink: [Boolean]
        //  }`
        $.bwin.personalbutton.replaceMessage = function (options) {
            var message = options.message;
            var messageContainer = messageViewer
                    .find('li[data-rel="' + message.rel + '"]')
                    .first();

            messageContainer.html(message.text);

            if (options.doAddCloseLink) {
                messageContainer.append(closeLink);
            }
        };

        // Can be used to remove all messages from viewer (arg is optional).
        $.bwin.personalbutton.removeMessages = function (messageForMatching) {
            var messages = messageViewer.find('li');

            if (messages.length > 0) {
                if (messageForMatching) {
                    // Remove all non-matching messages.
                    messages.each(function () {
                        var isMatchingMessage = $(this).hasClass(messageForMatching.type) &&
                                messageForMatching.rel === $(this).data('rel');

                        if (!isMatchingMessage) {
                            $(this).remove();
                        }
                    });
                } else {
                    // Remove all messages.
                    messages.each(function () {
                        $(this).remove();
                    });
                }

                messages = messageViewer.find('li');

                // Handle having messages indication class on personal button accordingly.
                if (messages.length === 0 && personalButton.hasClass('has-messages')) {
                    personalButton.removeClass('has-messages');
                }
            }
        };
    });
})(jQuery);


