(function ($) {
    if ($.bwin === undefined) {
        $.bwin = {};
    }
    var settings = {}, _getParamValue, _publicFn;

    _getParamValue = function (name) {
        var pattern, regex, results;
        name = name.replace(/[\[]/, '\\\[').replace(/[\]]/, '\\\]');
        pattern = '[\\?&]' + name + '=([^&#]*)';
        regex = new RegExp(pattern, 'i');
        results = regex.exec(window.location.search);
        if (results === null) {
            return '';
        } else {
            return decodeURIComponent(results[1].replace(/\+/g, ' '));
        }
    };

    _publicFn = {
        track: function () {
            var data, target, trackerId, zoneId;
            if (!settings.trackingUrl)
                return;

            trackerId = _getParamValue('trackerId');
            zoneId    = _getParamValue('zoneId');

            data = {};
            if (trackerId.length === 0 && zoneId.length === 0)
                return;

            if (trackerId.length > 0) {
                data["trackerId"] = trackerId;
            }

            if (zoneId.length > 0) {
                data["zoneId"] = zoneId;
            }

            target = settings.trackingUrl + '?' + $.param(data);
            $('<img>', { src: target });
        }
    };

    $.bwin.affiliate = function (options) {
        var defaults = {
            trackingUrl: ''
        };
        settings = $.extend(defaults, options);
        return $.extend(this, _publicFn);
    };
} (jQuery));

