(function ($) {
    if ($.bwin === undefined) {
        $.bwin = {};
    }

    var _makeContent, _bind, _open, _close, _minimize, _resize, _sendMessage, _settings;

    _makeContent = function () {
        var iframe = $('<iframe name="' + escape(window.location) + '"/>');
        iframe.attr({
            id: 'postlogin-frame',
            src: _settings.url,
            width: 475,
            scrolling: 'no',
            frameborder: 0,
            allowtransparency: true
        });
        return iframe;
    };

    _open = function (message) {
        var iframe;
        if (!$.bwin.dialog.isOpened()) {
            iframe = $('#postlogin-frame').show();
            $.bwin.dialog({
                body: iframe,
                top: _settings.top,
                left: _settings.left,
                cancel: _settings.cancel,
                showCloseIcon: false,
                closableViaOverlay: false,
                closableViaButtons: false
            });
        }
        _resize(message);
    };

    _close = function () {
        $.bwin.dialog.close();
    };

    _resize = function (dimensions) {
        $.bwin.dialog.resize(dimensions);
    };

    _minimize = function () {
        _close();
    };

    _sendMessage = function (message) {
        var iframe = $('#postlogin-frame'), data, hash, target;
        data = iframe.attr('src').split('#');
        target = data[0];
        hash = (data.length > 1 && data[1]) ? $.deparam(data[1]) : {};
        hash.plmsg = $.param(message);
        iframe.attr('src', target + '#' + $.param(hash));
    };

    _bind = function () {
        $(window).bind('hashchange', function (e) {
            var iframeMessage;
            _settings.isInitialized = true;
            iframeMessage = $.bbq.getState().dlg;

            if (!iframeMessage)
                return;

            var message = $.deparam(unescape(iframeMessage)) || {};
            $.bbq.removeState('dlg');

            // For debugging.
            //console.log('Hash fragment:', e.fragment);
            //console.log('IFrame message:', message);

            if (message.action === 'close') {
                _close();
            }

            if (message.action === 'minimize') {
                _minimize();
            }

            if (message.action === 'open') {
                _open(message);
            }

            if (message.action === 'resize') {
                _resize(message);
            }

            if (_settings.onMessageHandled) {
                _settings.onMessageHandled(message);
            }
        });
    };

    // Public functions.
    $.bwin.postlogin = function (options) {
        var defaults = {
            url: '',
            top: Math.round(parseInt($(window).height(), 10) / 6),
            left: Math.round((parseInt($(window).width(), 10) - 475) / 2),
            cancel: $.noop,
            onMessageHandled: $.noop,
            isInitialized: false
        };
        _settings = $.extend(defaults, options);

        //add the iframe to the page        
        if (_settings.url.length > 0) {
            $.bbq.removeState('dlg');
            _makeContent().hide().appendTo($('body'));
            _bind();
        }

        //return this;
    };

    $.bwin.postlogin.isInitialized = function () {
        return _settings.isInitialized;
    };

    $.bwin.postlogin.send = _sendMessage;

} (jQuery));

