(function ($) {

    // Ajax Omniture tracking.
    function _handleAjaxOmnitureTracking() {
        $(document).ajaxSuccess(function (e, xhr) {
            var trackingDataHeader = xhr.getResponseHeader('x-bwin-tracking-data');

            if (trackingDataHeader) {
                $.bwin.omniture({ trackingData: trackingDataHeader });
            }
        });
    }

    // Unobtrusive modal dialog link handling.
    function _handleModalDialogLinks() {
        $('.dialog-link').live('click', function (e) {
            var link = $.param.querystring(this.href, {
                _layout: 'layouts\\emptylayout'
            });
            var iframe = $('<iframe name="' + escape(window.location) + '"/>');
            var width = $(this).data('dialog-width');
            var left = Math.round((parseInt($(window).width(), 10) - width) / 2);
            iframe.attr({
                src: link,
                width: $(this).data('dialog-width'),
                height: $(this).data('dialog-height'),
                scrolling: 'no',
                frameborder: 0,
                allowtransparency: true
            });

            e.preventDefault();
            $.bwin.dialog({ left: left, width: width, body: iframe });
            return false;
        });
    }

    function _overrideValidatorMethods() {
        // Overridden validator methods for i18n.
        $.validator.methods.number = function (value, element) {
            return this.optional(element) ||
                    /^-?(?:\d+|\d{1,3}(?:,\d{3})+)(?:[\.,]\d+)?$/.test(value);
        };

        $.validator.methods.range = function (value, element, param) {
            var i18nValue = value.replace(',', '.');
            return this.optional(element) ||
                    (i18nValue >= param[0] && i18nValue <= param[1]);
        };
    }

    function _extendSelectorExpressions() {
        // Add regex selector expression.
        $.expr[':'].regex = function (elem, index, match) {
            var matchParams = match[3].split(','),
                validLabels = /^(data|css):/,
                attr = {
                    method: matchParams[0].match(validLabels) ?
                        matchParams[0].split(':')[0] : 'attr',
                    property: matchParams.shift().replace(validLabels, '')
                },
                regexFlags = 'ig',
                regex = new RegExp(matchParams.join('').replace(/^\s+|\s+$/g, ''), regexFlags);
            return regex.test($(elem)[attr.method](attr.property));
        };
    }

    // Login form handling.
    function _handleLoginForm() {
        $('#auth-form-container').find('form').bwin_loginform();
    }

    // Inits datepicker controls.
    function _initDatepicker() {
        var pattern = $('#shortDatePattern').data('pattern');
        var messages = $.datepicker.regional[''];
        // TODO: localized messages via Sitecore.
        messages.currentText = 'today';
        messages.closeText = 'close';

        $.datepicker.setDefaults(messages);

        // Overriden for required functionality.
        $.datepicker._gotoToday = function (id) {
            var inst = this._getInst($(id)[0]);
            var dateStr = this._formatDate(inst,
                    inst.selectedDay, inst.drawMonth, inst.drawYear);

            inst.input.val(dateStr);
            this._setDate(inst, new Date());
            this._updateAlternate(inst);
            this._hideDatepicker();
        };

        $('#main').find('.datepicker').datepicker({
            showButtonPanel: true,
            dateFormat: pattern,
            altField: '.datepicker-altfield',
            altFormat: 'yy-mm-dd'
        });
        $('#main').find('.datepicker-birthdate').datepicker({
            defaultDate: '01/01/1992'
        });
        $('#ui-datepicker-div').hide();
    }

    // Uniform controls.
    function _applyUniform() {
        $('input:submit, input:checkbox, input:radio, input:file, button, select').bwin_uniform();
    }

    // Basic progressive enhancement.
    function _progressivelyEnhance() {
        $('.js .show').show();
        $('.js .hide').hide();
    }

    function _renderServerTime() {
        var _startTime = $('#server-time').data('time'),
            _millis;
        if (!_startTime) return;

        // one must cancel the client-side JS timezone offset automatically added 
        // when you call toLocaleTimeString on a date -- fun stuff :)
        _millis = _startTime;
        setInterval(function () {
            _millis += 1000;
            $('#server-time').text(new Date(_millis + (new Date().getTimezoneOffset() * 60000)).toLocaleTimeString());
        }, 1000);
    }

    function _handleSignUpBonus() {
        /*main page handling - opens bonus layer dialog*/
        var targetUrl, qs, delim, domain, reminder = $('#bonus-reminder');
        domain = $('html').data() ? $('html').data().domain : location.host;

        if (reminder.length > 0) {
            targetUrl =
                reminder.find("a:first").prop("href");

            var openDialog = function (url) {
                var iframe = $('<iframe />', {
                    src: url,
                    scrolling: 'no',
                    frameborder: 0,
                    allowtransparency: true
                });
                $.cookie('bonus-min', null, { path: '/', domain: domain });
                $.bwin.dialog({ body: iframe, width: 336, left: Math.round((parseInt($(window).width(), 10) - 336) / 2), showCloseIcon: false });
            };

            qs = $.deparam(document.location.search.toLowerCase().replace('?', ''));
            if (qs.trackerid) {
                delim = (targetUrl.indexOf('?') > -1 ? '&' : '?');
                openDialog(targetUrl + delim + 'bonusId=' + qs.trackerid);
            }

            if ($.cookie('bonus-min')) {
                reminder.show();
            }

            reminder.find('a:first').click(function (e) {
                e.preventDefault();
                var url = $.cookie('bonus-min');
                reminder.fadeOut();
                openDialog(url);
                $.cookie('bonus-min', null, { path: '/', domain: domain });
            });
        }

        /*inside bonus layer dialog handling*/
        if (window != window.top) {
            $(document).ready(function () {
                parent.$.bwin.dialog.resize({ width: $(document).outerWidth() });
            });

            $('#bonus .tac-header').click(function (e) {
                e.preventDefault();
                var arrow = $(this).find('.ui-icon:first');
                var tac = $(this).next();
                tac.toggle();
                if (tac.is(':visible')) {
                    arrow.removeClass('ui-icon-triangle-1-e');
                    arrow.addClass('ui-icon-triangle-1-s');
                }
                else {
                    arrow.removeClass('ui-icon-triangle-1-s');
                    arrow.addClass('ui-icon-triangle-1-e');
                }

                parent.$.bwin.dialog.resize({ height: $('#bonus').outerHeight() });
            });

            $('#bonus .remindme').click(function (e) {
                e.preventDefault();
                parent.$.cookie('bonus-min', document.location.href, { path: '/', domain: domain });
                parent.$('#bonus-reminder').fadeIn();
                parent.$.bwin.dialog.close();
            });

            $('#bonus #dialog-close').click(function(e) {
                e.preventDefault();
                parent.$.bwin.dialog.close();
            });
        }
    }

    $(function () {
        _renderServerTime();
        _progressivelyEnhance();
        _applyUniform();
        _initDatepicker();
        _handleLoginForm();
        _extendSelectorExpressions();
        _overrideValidatorMethods();
        _handleModalDialogLinks();
        _handleAjaxOmnitureTracking();
        _handleSignUpBonus();

        $.bwin.omniture();
        $.bwin.personalbutton();
        $.bwin.langswitch();
    });

})(jQuery);